	dc.b	"You're not powerful enough", $FE
	dc.b	"to stand a chance at that.", $FD
	dc.b	"Nonetheless, I propose", $FE
	dc.b	"a test. The Cave of Troy", $FE
	dc.b	"is outside of town.", $FD
	dc.b	"Return to me with", $FE
	dc.b	"the Treasure of Troy,", $FE
	dc.b	"and I'll give you my ring.", $FD
