	dc.b	"Enjoy your stay in", $FE
	dc.b	"Deepdale, traveler.", $FF, $00
loc_00030AA2:
	dc.b	"This town is", $FE
	dc.b	"amazingly peaceful.", $FF, $00
loc_00030AC4:
