	dc.b	"truffles to the king.", $FF, $00
loc_00030CF4:
	dc.b	"The king's a swell guy!", $FF
loc_00030D0C:
	dc.b	"Isn't the king", $FE
	dc.b	"in the castle?", $FF
loc_00030D2A:
	dc.b	"Greetings, stranger.", $FE
	dc.b	"Are you a visitor", $FE
	dc.b	"to our fair town?", $FF, $00
loc_00030D64:
