	dc.b	"have some? There goes my", $FE 
	dc.b	"secret identity, I guess.", $FD
	dc.b	"You want the Ring of Wind?", $FE
	dc.b	"Here, you will put it to", $FE
	dc.b	"better use than I.", $FD
	dc.b	"I hope that you complete", $FE
	dc.b	"your quest before Cartahena", $FE
	dc.b	"destroys us all.", $FD
	dc.b	"Please don't tell", $FE
	dc.b	"anyone who I am.", $FE
	dc.b	"Thanks for the truffles!"
	dc.b	$F9, $02, $00, $0D, $00, $FA
