	dc.b	"Everyone has someone except", $FE
	dc.b	"me. Could you find someone", $FE
	dc.b	"for me? Take this sketch an", $FD
	dc.b	"artist drew of me. Perhaps", $FE
	dc.b	"someone would like to meet", $FE
	dc.b	"me after seeing this", $2E 
	dc.b	$F9, $01, $00, $16
