	dc.b	"I owe you my life,", $FE
	dc.b	"brave warrior.", $FF
loc_000374BA:
	dc.b	"You would be most welcome", $FE
	dc.b	"at our wedding next week.", $FF 
loc_000374EE:
	dc.b	"My daughter and I are", $FE
	dc.b	"most grateful to you.", $FF
loc_0003751A:
