	dc.b	"I'm so glad you recovered!", $FF, $00 
loc_0003A1FA
	dc.b	"The Digot plant can cure", $FE 
	dc.b	"the Eracle poison you ate.", $FF 
loc_0003A22E
	dc.b	"The army of Cartahena", $FE 
	dc.b	"gains strength daily.", $FF 
loc_0003A25A
	dc.b	"A woman gave you dinner", $FE 
